text:
Kekalahan Indonesia ada bebera faktor sebagai berikut :
1. Salah memilih pemain saat Garuda Calling dengan tidak memanggil Mees Hligers, Marselino dan Ivan Jenner;
2. Salah memilih pemain saat melawan Arab Saudi;
3. AFC Penyeleggara Round 4 melakukan penyalagunaan wewenang sebagai Asosiasi Sepak Bola Asia;
4. Wasit berlaku curang saat memimpin pertandingan.
